import React from 'react'
import './Header.css';
const Header = () => {
  return (
    <div>
         
        <header className='Container'>
         
                <nav>
                  <a href='#'>Home</a>
                  <a href='#'>Blogs</a>
                  <a href='#'>Contact Me</a>
                </nav>
           
        </header>
   
    </div>
  )
}

export default Header
